import React from 'react'
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom'

function Pages() {
  return(
    <Router>
      <Switch>
        <Route path="/creopalette/">
          <Home />
        </Route>
      </Switch>
    </Router>
  )
}

export default Pages;
